import { useEffect, useState } from "react";
import Log from "./log";
import Main from "./main";
import './app.css'
function App() {
  const [log,stlog]=useState(null)
  useEffect(()=>{
    stlog({
      id:sessionStorage.getItem("log"),
      present:true,
      worktime:'8:45-4:40',
      holiday:['harish']
    })
  },[])
  return (
    <div className="App">
      <div className="head">
        <div className="headimg"></div>
      </div>
      {log?<Main data={log}/>:
      <Log/>}
    </div>
  );
}

export default App;
